import React, {Component} from 'react';

class Article extends Component {
  render(){
    let articles = [];
    let datas = this.props.data;
    console.log(datas)
    console.log(datas[0])
    datas.forEach(data =>
      articles.push(
        <content key={data.id}>
          <h1>{data.title}</h1>
          <p>{data.body}</p>
        </content>
      )
    );
    return(
      <article>
        {articles}
      </article>
    )
  }
}

export default Article;
